  true,\n\t\"url\": null,\n\t\"notes\": \"Source data for this variable were obtained
  from the USGS Land Cover Trends Project. Annual maps of LULC were extrapolated for
  baseline years (1992 to 2005) and modelled for future years (2006-2050) based on
  selected IPCC emissions scenarios. The spatial extent is the conterminous United
  States and the temporal extent is from 1992 through 2050. These data are projected
  to Albers Equal Area in the NAD83 datum at a resolution of 250 meters and are spatially
  gridded in GeoTiff format. LULC classes: Open Water, Urban/Developed, Mechanically
  Disturbed National Forest, Mechanically Disturbed Other Public Land, Mechanically
  Disturbed Private Land, Mining, Barren, Deciduous Forest, Evergreen Forest, Mixed
  Forest, Grassland, Shrubland, Cultivated Crop, Hay/Pasture, Herbaceous Wetland,
  Woody Wetland, Ice/Snow.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
